import React from "react";
import CarbonFootPrint from "../Components/CarbonFootPrint";

const CarbonFootprintPage = () => {
    return (
        <div className="p-4">
            <h1 className="text-2xl font-bold">Carbon Footprint Comparison</h1>
            <CarbonFootPrint />
        </div>
    );
};

export default CarbonFootprintPage;
